import React from 'react'
import "./NavBar.css"

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCaretDown } from '@fortawesome/free-solid-svg-icons'
import { useState } from 'react'

function NavBar() {
    const [show, setshow] = useState(true)
    return (
        <div className="navbar">
            <img className="logo" src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/1920px-Netflix_2015_logo.svg.png" alt="Netflix" />
            <img className="avatar" src="https://www.yorkoptometryclinic.ca/images/img_avatar.png" alt="" />
            {
                show?<h1>Hello World !</h1>:null
            }
           
            <FontAwesomeIcon  className="icon" icon={faCaretDown} color="white"/>
        </div>
    )
}
export default NavBar
